import React from 'react';
import './Player.scss';

const Player = () => {
    return (
        <div className='Player'>
            <div className="Player__top"></div>
            <div className="Player__bottom">
                <div className="Player__controls">
                    <div className="Player__controls-btn-box">
                        <i className="fas fa-redo-alt Player__controls-btn Player__loop-btn"></i>
                    </div>
                    <div className="Player__controls-btn-box Player__previous-track-btn">
                        <i className="fas fa-redo-alt Player__controls-btn Player__loop-btn"></i>
                    </div>
                    <div className="Player__controls-btn-box Player__play-btn"></div>
                    <div className="Player__controls-btn-box Player__next-track-btn"></div>
                    <div className="Player__controls-btn-box Player__shuffle-btn"></div>
                </div>

                <div className="Player__lyrics"></div>
            </div>
        </div>
    );
};

export default Player;
